import React, { useState, useEffect } from "react";
import axios from "axios";


const Product = () => {
        const [product, setProduct] = useState([]);
        useEffect(() => {
          getProduct();
        }, []);
      
        const getProduct = () => {
          axios
            .get("products.json")
            .then((response) => {
              setProduct(response.data);
            })
            .catch((error) => {
              console.log(error);
            });
        };

        return (
            <div>
              {product.map((product) => (
                <div key={product.name}>
                  <h1>{product.name}</h1>
                </div>
              ))}
            </div>
          );
};

export default Product;
